import React from 'react';
import UserList from './components/UI/UserList';
import AddUser from './components/Users/AddUser';


usersList = [{name: "Roberto", age:"12"}, {name:"Kayla" ,age:"30"}]


function App() {
  return (
    <div>
      <AddUser/>
      <UserList users={[UserList]}/>
    </div>
  );
}

export default App;
